import React, { useState } from 'react';

const Domainchecker = () => {

    const [domainName, setDomainName] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();

        const getdomain = { domainName };

        console.log(getdomain);

        fetch('http://localhost/hynitr/dothost/api', {
            method: 'POST',
            body: JSON.stringify()

        })

    }

    return ( 

        <form onSubmit={handleSubmit}>
            <input type="text" value={domainName} onChange={(e) => setDomainName(e.target.value)} placeholder="Enter Your Domain Name" className="text-secondary" required/>
            <input type="submit" value="Search"/>
        </form>
     );
}
 
export default Domainchecker;
